#include <bits/stdc++.h>
using namespace std;
int main(){
  int N;
  cin>>N;
  vector<pair<string,string>> P(N);
  vector<string> S;
  string s;
  for (int i=0;i<N;i++){
    cin>>P[i].first;
    P[i].second=P[i].first;
    sort(P[i].first.begin(),P[i].first.end());}
  sort(P.begin(),P.end());
  s=P[0].second;
  for(int i=1;i<N;i++){
    if(P[i].first==P[i-1].first){s+=" ";s+=P[i].second;}
    else{S.push_back(s);s=P[i].second;}}
  S.push_back(s);
  sort(S.begin(),S.end());
  for(int i=0;i<S.size();i++){
    if(S[i].find(' ')!=string::npos){cout<<S[i]<<endl;}}}
